script: |
  super -f tsv -I q960.sql | sort > q960.out

vector: true

inputs:
  - name: q960.sql
    data: |
      SELECT DISTINCT + col2 * + CAST ( + col2 AS REAL ) AS col0, col1 AS col2 FROM tab1 AS cor0 WHERE NOT - 97 * col2 NOT IN ( - - col2, col1, + col0 * 56 * + + col0 * + col2 );
  - name: tab1

outputs:
  - name: q960.out
    data: |
